INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2188','3008','1','','','：我院离退休党员同志为深入推进我院离退休党员干部“进一步解放思想，激励新时代新担当新作为”学习教育活动，巩固大家一年来“两学一做”的学习成果，回顾党的历史，增强对党的事业的感情，进一步提高我院离退休党员干部的综合素质，经院领导同意，在建党97周年到来之','192.168.162.110','192.168.162.110','1530547200','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体; font-size: 20px;\">：我院离退休党员同志</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体; background: white;\">为深入推进我院离退休党员干部“进一步解放思想，激励新时代新担当新作为”学习教育活动，巩固大家一年来“两学一做”的学习成果</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体;\">，回顾党的历史，增强对党的事业的感情，</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体; background: white;\">进一步提高我院离退休党员干部的综合素质，</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体;\">经院领导同意，在建党97周年到来之际，决定在我院离退休党员中开展纪念建党周年知识竞赛活动。现将有关事项通知如下：</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">一、参赛人员</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">党组织关系在老干部支部的党员同志。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">二、竞赛时间</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 19px; font-family: 宋体;\">7月4日下午3：00—4：00。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><span style=\"font-size: 19px; font-family: 宋体; color: black; background: white;\">三、</span><strong><span style=\"font-size: 19px; font-family: 宋体;\">竞赛内容</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; color: black; background: white; font-size: 20px;\">以《中国共产党章程》、《中共党史》、习近平《新时代中国特色社会主义思想三十讲》等学习辅导材料内容为主。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">四、参赛方式</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 19px; font-family: 宋体;\">1、笔试题共25题，全部为选择题。集中学习时现场在试题答题。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">五、奖励办法</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">获奖奖项根据参赛者答题得分情况由高分到低分采取现场抽奖方式产生。竞赛设一、二、三等奖和纪念奖。其中一等奖2名，二等奖4名，三等奖6名，纪念奖若干。所有获奖人员都将获得相应的奖品。 </span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体; font-size: 20px;\">市一院老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体; font-size: 20px;\">二O一八年七月三日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2189','3009','1','','','：各位离退休老同志你们好！在院领导的关心下，在体检中心的各位同仁的大力支持下，我院定于3月19日－3月24日为全院离退休职工安排一次健康检查。每位离退休职工的体检表和体检时间我们都已安排好，请各位老同志本人于3月16日前到院离退休干部处领取（原则上本次体检表','192.168.162.110','192.168.162.110','1520870400','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休老同志</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">你们好！</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在院领导的关心下，在体检中心的各位同仁的大力支持下，我院定于3月19日－3月24日为全院离退休职工安排一次健康检查。每位离退休职工的体检表和体检时间我们都已安排好，请各位老同志本人于3月16日前到院离退休干部处领取（原则上本次体检表不得代领，确有特殊情况需请人代领的同志，请代领人持被领人的身份证），请各位严格按照规定时间去完成体检。组织关系在老干部支部的党员同志来领体检表的时候请一并将2018年度的党费交纳一下！</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">由于离退休职工人员较多，我们不再一一电话通知，凡看到通知的同志，敬请相互转告！谢谢！</span><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span></p><p style=\"line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">市一院离退休干部处</span></p><p style=\"line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年3月13日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2190','3010','1','','','：各位离退休老同志，你们好根据国家计生委副主任崔丽同志在全国“两会”期间卫生计生系统安全稳定工作讲话精神要求，院党委充分认识到卫生计生系统安全生产形势的严峻性，立即召开医院安全工作会议，院领导就医院安全、消防安全、后勤保障、信访稳定、卫生应急、应急值','192.168.162.110','192.168.162.110','1519833600','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休老同志，你们好</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px; text-indent: 2em;\">根据国家计生委副主任崔丽同志在全国“两会”期间卫生计生系统安全稳定工作讲话精神要求，院党委充分认识到卫生计生系统安全生产形势的严峻性，立即召开医院安全工作会议，院领导就医院安全、消防安全、后勤保障、信访稳定、卫生应急、应急值守和信息报送等方面工作做了具体的要求。广大离退休老同志虽然离开了工作岗位，但安全与每个人的切身利益密切相关，大家应时刻紧绷安全意识这根弦。请大家自觉做好自身家庭安全隐患的排查工作，保证家里的水、电、气的安全，严防火灾；节日里各种美食诱人，大家要注意食品安全，保护身体健康；走亲访友出行要遵守交通规则，注意阴雨天的交通安全；不扬言滋事或参与大规模的聚集活动，不参与违法越级上访活动，远离非法聚众闹事；不在公共场合或网络上发布反动言论。如发现安全隐患，请及时与医院领导或老干部支部主动联系，以确保两会期间我院离退休干部队伍的稳定。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">联系电话：13626200808 </span></p><p><br /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 市一院离退休干部处</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 二O一八年三月一日</span></p><p><br /></p>','','','','','');
