INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2225','3047','1','','','各医疗设备生产企业、经营企业：盐城市儿童医院由盐城市第一人民医院代筹建，拟采购一批医疗设备（设备清单见附件2），项目资金已落实，将于近期开展市场调研，欢迎符合条件的医疗设备生产企业、经营企业前来参与。本次采购设备品种多、数量大、时间紧，市场调研将根据','192.168.162.110','192.168.162.110','1628044741','<div style=\"page:WordSection1;layout-grid:15.6pt\">\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">各医疗设备生产企业、经营企业：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">盐城市儿童医院由盐城市第一人民医院代筹建，拟采购一批医疗设备（设备清单见附件<span>2</span>），项目资金已落实，将于近期开展市场调研，欢迎符合条件的医疗设备生产企业、经营企业前来参与。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">本次采购设备品种多、数量大、时间紧，市场调研将根据医院基建进度、运营情况开展，分批采购、分步执行。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.2pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">因受新冠肺炎疫情影响，本次调研活动只接受邮寄、邮件的非现场方式。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.2pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">报名材料要求：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:64.2pt;\r\nmargin-bottom:.0001pt;text-indent:-36.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black\">1、<span style=\"font:7.0pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">填写附件<span>1</span>《</span><span style=\"font-size:14.0pt;\r\nline-height:1.5;font-family:仿宋,仿宋_GB2312\">医用设备咨询登记表</span><span style=\"font-size:14.0pt;\r\nline-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:white\">》发送至邮箱。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:64.2pt;\r\nmargin-bottom:.0001pt;text-indent:-36.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312\">2、<span style=\"font:7.0pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312\">按照附件<span>3</span>要求准备纸质材料，邮寄到设备处。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">邮寄地址：盐城市毓龙西路<span>166</span>号盐城市第一人民医院设备处</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;backgr