er-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">UBM</span><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">超声生物显微镜</span></p>\r\n      </td>\r\n      <td width=\"139\" style=\"width: 104pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:宋体;color:black\">1</span></p>\r\n      </td>\r\n      <td style=\"height: 15.6pt; border: none; text-align: center;\" width=\"0\" height=\"21\"></td>\r\n    </tr>\r\n    <tr style=\"height:15.6pt\">\r\n      <td width=\"61\" style=\"width: 46.05pt; border-right: 1pt solid black; border-bottom: 1pt solid black; border-left: 1pt solid black; border-image: initial; border-top: none; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">54</span></p>\r\n      </td>\r\n      <td width=\"252\" style=\"width: 188.7pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">角膜测厚仪<span>&nbsp;&nbsp;&nbsp;\r\n      </span></span></p>\r\n      </td>\r\n      <td width=\"139\" style=\"width: 104pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:宋体;color:black\">1</span></p>\r\n      </td>\r\n      <td style=\"height: 15.6pt; border: none; text-align: center;\" width=\"0\" height=\"21\"></td>\r\n    </tr>\r\n    <tr style=\"height:15.6pt\">\r\n      <td width=\"61\" style=\"width: 46.05pt; border-right: 1pt solid black; border-bottom: 1pt solid black; border-left: 1pt solid black; border-image: initial; border-top: none; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">55</span></p>\r\n      </td>\r\n      <td width=\"252\" style=\"width: 188.7pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">同视机<span>&nbsp;&nbsp;\r\n      </span></span></p>\r\n      </td>\r\n      <td width=\"139\" style=\"width: 104pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:宋体;color:black\">2</span></p>\r\n      </td>\r\n      <td style=\"height: 15.6pt; border: none; text-align: center;\" width=\"0\" height=\"21\"></td>\r\n    </tr>\r\n    <tr style=\"height:15.6pt\">\r\n      <td width=\"61\" style=\"width: 46.05pt; border-right: 1pt solid black; border-bottom: 1pt solid black; border-left: 1pt solid black; border-image: initial; border-top: none; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">56</span></p>\r\n      </td>\r\n      <td width=\"252\" style=\"width: 188.7pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312;color:black\">冷冻治疗仪<span>&nbsp;\r\n      </span></span></p>\r\n      </td>\r\n      <td width=\"139\" style=\"width: 104pt; border-top: none; border-left: none; border-bottom: 1pt solid black; border-right: 1pt solid black; padding: 0.6pt 0.6pt 0cm; height: 15.6pt; text-align: center;\">\r\n      <p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:center;vertical-align:middle\"><span style=\"font-size:12.0pt;font-family:宋体;color:black\">2</span></p>\r\n      </td>\r\n      <td style=\"height: 15.6pt; border: none; text-align: center;\" width=\"0\" height=\"21\"></td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span>&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span>&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span>&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span>&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: center; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span>&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:8.0pt;margin-right:0cm;\r\nmargin-bottom:8.0pt;margin-left:0cm;text-indent:0cm\"><span style=\"font-size:\r\n14.0pt;font-family:宋体\">附件<span>3</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:center;\r\nline-height:1.5\" align=\"center\"><span style=\"font-size:18.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:white\">盐城市儿童医院医疗设备采购产品调研材料</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">有意愿参与调研活动的医疗设备生产企业或经营企业请提交产品调研文件一套，并保证所提供的各种材料真实、有效、齐全，承担相应的法律责任。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">请按下列顺序装订：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">一、封面，请注明采购科室、产品名称、品牌、型号、规格、供应商公司名称、联系人姓名及联系方式等信息。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">二、产品资质（包括注册证、国际认证等）及简介，附一份查询注册证时的药监部门网站截图。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">三、提供设备生产厂家对投标产品的设计使用期限信息（如说明书、注册证、铭牌等）复印件或照片，并提供设备超出使用期限后使用可能存在潜在临床风险及法规问题。如无明确要求则请出具原厂说明文件并加盖原厂及供应商公司公章。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">四、配置清单（请单独成页，不与其他信息共存）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">五、报价表，内容包含产品名称、品牌、型号、产地、报价（人民币或美元，含货至我院指定地点的运输、保险、安装、税费等所有费用）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">六、产品技术参数。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">七、产品安装场地等要求（请提供设备原厂家需求文件）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">八、生产厂家和代理公司资质及简介。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">九、生产厂家授权书。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">十、售后服务条款承诺（附件三）</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">十一、其他医院（以三甲医院为主）中标通知书或合同及相应配置（如盐城市第一人民医院一年内采购过，提供其采购合同和相应配置）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">十二、该设备如需配套在我院未正式使用的专用耗材或专用试剂，调研材料中必须重点说明。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">十三、用户名单、采购时间及联系人。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">十四、宣传彩页（纸质版需要提供印刷版，打印和复印版无效；<span>pdf</span>版需扫描彩页）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">十五、调研材料真实性及购销廉洁声明。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-indent:28.0pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">上述材料正本必须加盖参与调研的生产或经营公司的公章，复印公章无效。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;line-height:1.5\"><span style=\"font-size:14.0pt;line-height:1.5;font-family:仿宋,仿宋_GB2312;color:black;background:\r\nwhite\">&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;line-height:21.6pt;background:white\"><strong style=\"font-family:\'Times New Roman\',\'serif\'\"><span style=\"font-size:15.0pt;\r\nfont-family:仿宋,仿宋_GB2312;color:#333333;background:white\">附件<span>4</span></span></strong></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;line-height:21.6pt;background:white\"><strong style=\"font-family:\'Times New Roman\',\'serif\'\"><span style=\"font-family:仿宋,仿宋_GB2312;\r\ncolor:#333333;background:white\">甲方：盐城市第一人民医院</span></strong><strong style=\"font-family:\'Times New Roman\',\'serif\'\"><span style=\"font-family:宋体;color:#333333;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></strong><strong style=\"font-family:\'Times New Roman\',\'serif\'\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">乙方：设备供应公司</span></strong></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n5.4pt;text-indent:8.4pt;line-height:21.6pt;background:white\"><strong style=\"font-family:\'Times New Roman\',\'serif\'\"><span style=\"font-size:8.0pt;font-family:宋体;color:#333333;background:white\">&nbsp;</span></strong></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">乙方免费提前为甲方提供设备安装图纸，并充分协助甲方做好机房的准备工作（如必要的话）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">乙方负责设备的免费安装和调试，必须事先与甲方设备处联系，并与设备处共同参与，否则引起的一切责任由乙方承担。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">所有医疗设备必须提供符合国家标准的电源线，插头制式必须为中国标准制式，保证安全接地，不接受欧标、美标等制式电源线，设备出厂时间不能超过壹年。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">乙方逾期交付货物的，每逾期一天，乙方向甲方偿付货款总额<span>5</span>‰的滞纳金，如乙方逾期交货达<span>10</span>天，甲方有权解除合同或双方协商赔偿方式。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">装机所产生的垃圾必须摆放整齐，不得有影响工作人员、病人及家属安全通过的行为。公司在装机后<span>24</span>小时内必须完成对包装拆除物的清理。因包装拆除物原因引起的医疗事故和纠纷，由公司承担全部法律和经济责任。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">设备安装、调试结束后，甲方对设备试用后进行验收（时间由甲、乙双方商定），乙方免费派工程师到达现场协助验收工作。保修期自甲方验收合格之日算起，保修期外故障待修复后只收配件费，免收上门费、人工费。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">上述设备原厂免费保修</span><span style=\"font-family:仿宋,仿宋_GB2312;color:red;background:white\"> </span><span style=\"font-family:仿宋,仿宋_GB2312;color:red;background:white\">叁</span><span style=\"font-family:宋体;color:red;background:white\"> </span><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">年，保修范围包括合同中所有配置。并确保设备保修期内开机率≥<span>95%</span>，如设备故障停机率超过<span>5%</span>（一年按<span>365</span>天计算，每年<span>18</span>天），每超过一天，保修期延长两周。保修期外乙方对本设备终身负责维修。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;\r\ncolor:#333333;background:white\">如设备发生故障，乙方在接到甲方报修电话后<span>1</span>小时之内响应，<span>3</span>小时内到达甲方现场（若无维修站点，<span>24</span>小时内到达现场），<span>48</span>小时内修复或免费提供备用机，否则甲方可自行采取必要的措施，由此产生的风险和费用由乙方承担。如有特殊情况，乙方应立即电话通知甲方不能响应的原因，在获得甲方同意后，才可推迟响应时间。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">保修期内每年不少于</span><span style=\"font-family:仿宋,仿宋_GB2312;color:red;background:white\"> 两</span><span style=\"font-family:宋体;color:red;background:white\"> </span><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">次定期维护。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">无论在保修期内还是保修期外，乙方必须上门维修，乙方工程师至甲方维修本设备，必须事先与甲方设备处取得联系，并做相应登记；在维修过程中与甲方工程师共同完成维修工作。否则引起的一切责任由乙方负责。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">如设备软件升级，乙方负责免费软件升级，保证软件为最新、最高版本。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">如有设备具有远程维修诊断功能，乙方负责免费为甲方安装。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">乙方免费提供全套资料，含产品合格证（国产设备）、出厂计量合格证（强检设备）、操作手册、维修手册（含详细电路图）、海关报关单（进口设备）、商检合格证明（进口设备），如技术资料不全，甲方有权不支付货款。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">技术培训：在安装过程中或安装结束后，乙方工程师或有关人员有义务对甲方工程师和操作人员进行现场维修、保养、操作培训并提供快捷操作指南（过塑封好，挂在设备上），解答甲方人员提出的问题。必要时提供正规培训班培训，确保操作人员掌握完成日常工作所需的基本操作方法为止，工程师掌握基本的维护保养操作技术为止。详见乙方公司承诺书。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:6.6pt;margin-right:0cm;margin-bottom:6.6pt;margin-left:\r\n0cm;text-indent:24.0pt;line-height:21.6pt;background:white\"><span style=\"font-family:仿宋,仿宋_GB2312;color:#333333;background:white\">如乙方提供的设备设有维修软件密码，乙方保证无条件地为甲方永久免费打开。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\'\"><span style=\"font-size:12.0pt;font-family:仿宋,仿宋_GB2312\">&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\'\"><span>&nbsp;</span></p>\r\n</div>','','','','','');
