ont-family:宋体;color:#333333\">4.</span><span style=\"font-family:宋体;color:#333333\">近<span>3</span>年内在经营活动中无严重不良记录。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">5.</span><span style=\"font-family:宋体;color:#333333\">按要求填写《盐城市第一人民医院设备咨询报名表》（见附件）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">6.</span><span style=\"font-family:宋体;color:#333333\">报名截止时间：<span>2021</span>年<span>8</span>月<span>14</span>日<span>24</span>：<span>00</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;layout-grid-mode:char;font-size:11.0pt;font-family:\'Tahoma\',\'sans-serif\';text-indent:36.0pt;line-height:30.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;color:#333333\">联系人：李老师<span>&nbsp;\r\n</span>联系方式：<span>0515-88508946&nbsp; QQ:651830413(</span>推荐<span>)</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;layout-grid-mode:char;font-size:11.0pt;font-family:\'Tahoma\',\'sans-serif\';text-indent:36.0pt;line-height:30.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;color:#333333\"><span>附件：<img border=\"0\" src=\"/ewebeditor/sysimage/icon16/doc.gif\"><a href=\"/ewebeditor/uploadfile/file/2021/08/12/20210812101251199.docx\" target=\"_blank\">盐城市第一人民医院设备咨询报名表.docx</a></span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2233','3055','1','','','根据市委巡察工作领导小组的安排，2021年8月12日下午，市委第二巡察组向盐城市第一人民医院党委反馈巡察“回头看”情况。会上，市委第二巡察组组长王胜利向市一院党委反馈了巡察情况。市委巡察工作领导小组成员、市纪委常委、市委巡察办主任张国锋传达市委书记专题会议','192.168.162.110','192.168.162.110','1628847645','<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">根据市委巡察工作领导小组的安排，<span>2021</span>年<span>8</span>月<span>12</span>日下午，市委第二巡察组向盐城市第一人民医院党委反馈巡察“回头看”情况。会上，市委第二巡察组组长王胜利向市一院党委反馈了巡察情况。市委巡察工作领导小组成员、市纪委常委、市委巡察办主任张国锋传达市委书记专题会议精神，并对巡察反馈意见整改工作提要求；市卫健委党委书记、主任崔国静，盐城市第一人民医院党委书记查文章分别作表态发言。会议由查文章主持。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">根据市委统一部署，<span>2021</span>年<span>4</span>月<span>12</span>日至<span>6</span>月<span>11</span>日<span>,</span>市委第二巡察组对盐城市第一人民医院党委巡察“回头看”。巡察组坚持以习近平新时代中国特色社会主义思想为指导，深入贯彻党的十九大精神，坚持政治巡察定位，把“两个维护”作为根本任务，重点聚焦落实党的理论路线方针政策和中央、省市委决策部署情况，聚焦群众身边腐败问题和不正之风，聚焦党组织领导班子和干部人才队伍建设情况，对巡视巡察、主题教育等整改情况进行重点检查，顺利完成了巡察任务。市委书记专题会议和市委巡察工作领导小组分别听取了巡察组的巡察情况汇报。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">王胜利指出，近年来，市一院党委坚持以习近平新时代中国特色社会主义思想为指导，贯彻党的卫生与健康工作方针，落实中央、省市委决策部署，推进“健康盐城”建设。加强医院党的建设工作，推动多院区协调发展，着力提高医疗技术水平，提升医疗服务质量，不断增强可持续发展的能力，在支援武汉抗疫、做好我市新冠疫情防控工作和重特大险情医疗救护等方面做出了重要贡献。巡察组在巡察过程中发现和干部群众反映了一些问题，主要是：学习贯彻习近平新时代中国特色社会主义思想不深、不透，推进高质量发展不够有力；贯彻落实新时代党的组织路线有偏差，基层党建和干部人才队伍建设存在薄弱环节；贯彻落实全面从严治党战略部署不够坚决，落实主体责任和监督责任存在差距等等。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">王胜利提出三点意见建议：一要坚持党的全面领导，认真贯彻落实上级重大决策部署；二要深化公立医院改革，多措并举推动医院高质量发展；三要强化党建引领工作，推动全面从严治党向纵深发展。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">张国锋传达了市委书记专题会议精神，并受市委巡察工作领导小组委托，对下一步的整改工作提出三点意见：一是提升政治站位，切实增强抓好巡察整改的责任感、使命感；二是强化责任担当，坚决打赢巡察整改攻坚战、持久战；三是突出效果导向，确保巡察整改真到位、全到位\r\n。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">崔国静表示，一要坚定政治自觉，全面认领巡察反馈意见。二要坚决从严从实，全面抓好反馈问题整改。三要坚持系统思维，全面推动管党治党纵深发展。她要求市一院党委切实扛起巡察整改的政治责任，切实履行主体责任，以强有力的组织领导抓好整改任务落实，以过硬措施推进反馈问题全面彻底整改到位。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">查文章表示，市一院党委对巡察反馈的所有问题诚恳接受、主动认领、照单全收、从严整改。一是提高政治站位，坚决履行巡察整改政治责任。二是坚持问题导向，切实做好巡察意见整改落实。三是用好巡察成果，统筹推进整改工作提质增效。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:28.0pt;line-height:22.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">市委第二巡察组副组长王康、刘汝华、葛育富，市纪委监委第十五派驻纪检监察组组长陈友根，市卫健委党委委员、副主任王勇，市委第二巡察组全体工作人员，市委组织部干部四处负责同志，市委巡察办综合处负责同志，市一院领导班子全体成员、近三年退休的院领导、“两代表一委员”、医院各内设机构负责人、纪检监察、组织人事部门等有关人员出席会议。</span></p>','','','','','');
