INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2243','3065','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/0e16899f5a7dde32.jpg.thumb.jpg','对于肿瘤性疾病，多学科综合治疗协作组模式（MDT）是有效的手段。MDT以患者为中心，组成专家包括胃肠外科、肝胆外科、肿瘤内科、放疗科、介入科、放射和影像科、病理科等相关专业具有一定资质的医生。','192.168.162.110','192.168.162.110','1623309553','<p><span style=\"\">对于肿瘤性疾病，多学科综合治疗协作组模式（MDT）是有效的手段。MDT以患者为中心，组成专家包括胃肠外科、肝胆外科、肿瘤内科、放疗科、介入科、放射和影像科、病理科等相关专业具有一定资质的医生。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2244','3066','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/bfe27ee388d7c542.JPG.thumb.jpg','为进一步打造开放共享的医疗科研交流合作平台，加快普及百姓迫切所需的诊疗技术，6月28日上午，南京大学医学院盐城医学研究中心暨盐城市第一人民医院中心实验室揭牌成立！','192.168.162.110','192.168.162.110','1624951267','<p><span style=\"\">为进一步打造开放共享的医疗科研交流合作平台，加快普及百姓迫切所需的诊疗技术，6月28日上午，南京大学医学院盐城医学研究中心暨盐城市第一人民医院中心实验室揭牌成立！</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2245','3067','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/3b38c22d0f41363b.jpg.thumb.jpg','为更好地满足人民群众多样化、多层次的健康需求，尤其是为刚出院康复期患者、高龄或失能患者、孕产妇、残疾人以及其他有居家护理需求的特殊人群提供院内、院外同质化的优质护理服务，提高护理普及性和亲民性，盐城市第一人民医院“互联网+护理服务”项目，经过前期积极的筹备和试运行，现已正式上线！','192.168.162.110','192.168.162.110','1625124126','<p><span style=\"orphans: 2; text-align: justify; text-indent: 0px; widows: 2; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important; font-size: 16pt;\">为更好地满足人民群众多样化、多层次的健康需求，尤其是为刚出院康复期患者、高龄或失能患者、孕产妇、残疾人以及其他有居家护理需求的特殊人群提供院内、院外同质化的优质护理服务，提高护理普及性和亲民性，盐城市第一人民医院“互联网+护理服务”项目，经过前期积极的筹备和试运行，现已正式上线！</span></p>','','','','','');
