ext-indent:24.0pt;\r\nline-height:22.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.1</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须是具有《中华人民共和国基础电信业务经营许可证》的网络运营商的本地授权分支机构，或经营范围内含有“广播电视传输网络建设、改造、经营、维护和管理”的网络运营商的本地授权分支机构。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">3</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>23</span>日<span>8</span>时<span>30</span>分至<span>2021</span>年<span>8</span>月<span>27</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">4</span><span style=\"font-family:宋体;background:white\">、本项目采用“综合评估法”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">5</span><span style=\"font-family:宋体;background:white\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">6</span><span style=\"font-family:宋体;background:white\">、招投标监督管理机构及投诉电话：盐城市第一人民医院纪检监察室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">其余内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp; </span><span style=\"font-family:宋体;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white;word-break:break-all\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-family:宋体;background:white\">时间：<span>2021</span>年<span>8</span>月<span>23</span>日<span>&nbsp; </span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2251','3073','1','','','因疫情防控工作需要，盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目根据财办库【2020】23号《财政部办公厅关于疫情防控采购便利化的通知》文件，采用“绿色通道”进行便利化采购。现通过公开招标方式邀请潜在投标人参加本项目的投标，现就有关事项','192.168.162.110','192.168.162.110','1629706236','<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">因疫情防控工作需要，盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目根据财办库【<span>2020</span>】<span>23</span>号《财政部办公厅关于疫情防控采购便利化的通知》文件，采用“绿色通道”进行便利化采购。现通过公开招标方式邀请潜在投标人参加本项目的投标，现就有关事项公告如下：</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">一、项目基本情况</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">项目名称：盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">采购方式：公开招标 </span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">预算金额：<span>90</span>万元；最高限价：<span>90</span>万元。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">采购需求：盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目，包含但不限于车辆外部洗消系统、救护车内消毒系统、空间消毒系统、壁挂式等离子空气消毒机、智能衣服消毒柜等设备采购、安装及调试、洗消中心配套用房建设等相关伴随服务，具体内容详见招标文件中“项目需求”的约定。共设一个标段。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">合同履行期限：合同签订后<span>10</span>日历天内完成设备的供货、安装、调试、售前等相关伴随服务。具体交货期或交付使用期、开工日期以采购人发出开工令为准（期间材料风险由中标人充分考虑）。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">二、申请人的资格要求：</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.</span><span style=\"font-size:12.0pt;font-family:宋体\">满足《中华人民共和国政府采购法》第二十二条规定，并提供下列材料；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">(1)</span><span style=\"font-size:12.0pt;font-family:宋体\">法人或者其他组织的营业执照等证明文件，自然人的身份证明；<span><br>\r\n</span>　<span>&nbsp; (2)</span>上一年度的财务报表（成立不满一年不需提供）；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">(3)</span><span style=\"font-size:12.0pt;font-family:宋体\">依法缴纳税收和社会保障资金的相关材料；<span><br>\r\n</span>　　<span>(4)</span>具备履行合同所必需的设备和专业技术能力的书面声明；<span><br>\r\n</span>　<span>&nbsp; (5)</span>参加政府采购活动前<span>3</span>年内在经营活动中没有重大违法记录的书面声明；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">2.</span><span style=\"font-size:\r\n12.0pt;font-family:宋体\">落实政府采购政策需满足的资格要求：无</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">3.</span><span style=\"font-size:12.0pt;font-family:宋体\">本项目的特定资格要求：</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>1</span>）未被“信用中国”网站（<span>www.creditchina.gov.cn</span>）列入失信被执行人、重大税收违法案件当事人名单、政府采购严重失信行为记录名单。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>2</span>）单位负责人为同一人或者存在直接控股、管理关系的不同供应商，不得参加同一合同项下的政府采购活动。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>3</span>）本项目不接受联合体。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;font-weight:\r\nnormal\">三、获取采购文件</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt;background:white\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>23</span>日<span>8</span>时<span>30</span>分</span><span style=\"font-size:12.0pt;font-family:宋体\">至<span>2021</span>年<span>8</span>月<span>27</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13625222261</span>。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">四、响应文件提交</span></h2>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">响应文件提交截止时间：</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">2021</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">年</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">8</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">月</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">28</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">日上午</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">9</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">：</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">30</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">时；</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inte