INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2253','3075','1','','','因医院实际工作需要，于2021年8月28日进行招标的项目，经评标小组评审，中标结果如下：一、盐城市第一人民医院主院区病房电视信号接入服务中标单位：中国联合网络通信有限公司盐城市分公司中标价：5.2万元二、盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随','172.16.100.2','172.16.100.2','1630290452','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;\r\ncolor:#333333\">因医院实际工作需要，于<span>2021</span>年<span>8</span>月<span>28</span>日进行招标的项目，经评标小组评审，中标结果如下：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:28.0pt\"><b><span style=\"font-family:宋体;color:#333333\">一、盐城市第一人民医院主院区病房电视信号接入服务</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标单位：中国联合网络通信有限公司盐城市分公司</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标价：<span>5.2</span>万元</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:28.0pt\"><b><span style=\"font-family:宋体;color:#333333\">二、盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标单位：江苏卓冠医疗科技有限公司</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标价：<span>87.8</span>万元</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:\r\n宋体;color:#333333\">为体现公开、公平、公正的原则，特此公告三天。如有疑问请与盐城市第一人民医院监督审查室联系，电话<span>0515-66696810</span>。<span>&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:right;\r\ntext-indent:24.0pt;line-height:28.0pt\" align=\"right\"><span style=\"font-family:宋体;color:#333333\">盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:right;\r\ntext-indent:24.0pt;line-height:28.0pt\" align=\"right\"><span style=\"font-family:\r\n宋体;color:#333333\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2021</span><span style=\"font-family:\r\n宋体;color:#333333\">年<span>8</span>月<span>30</span>日</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:31.5pt;line-height:14.0pt\"><span>&nbsp;</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2254','3076','1','','','盐城市第一人民医院室内绿化招租及主院区绿化养护服务项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。1、项目概况1.1 项目名称：盐城市第一人民医院室内绿化招租及主院区绿化养护服务；1.2项目地点：盐城市第一人民医院','172.16.100.2','172.16.100.2','1630398147','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">盐城市第一人民医院室内绿化招租及主院区绿化养护服务项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、项目概况</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.1 </span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">项目名称：盐城市第一人民医院室内绿化招租及主院区绿化养护服务；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.2</span><span style=\"font-size:12.0pt;font-family:宋体\">项目地点：盐城市第一人民医院主院区、北区、五官科医院、紫薇门诊及皮肤科专科医院、盐城市儿童医院；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:21.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3</span><span style=\"font-size:12.0pt;font-family:宋体\">招标内容：盐城市第一人民医院主院区室内绿化招租及绿化养护服务，招标人保留调整招标范围的权力，中标人须无条件服从。主要内容如下：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3.1</span><span style=\"font-size:12.0pt;font-family:宋体\">室内绿化招租</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>1</span>）室内绿化招租范围：盐城市第一人民医院主院区、北区、五官科医院、紫薇门诊及皮肤科专科医院、盐城市儿童医院；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>2</span>）负责对摆放盆栽的运输、搬运、更换、日常养护及前期施工绿化景观养护等工作；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>3</span>）采购的各类盆栽应枝叶茂盛、修剪整齐；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:25.0pt\"><b><span style=\"font-size:12.0pt;font-family:宋体\">（<span>4</span>）应根据招标人的要求、不同季节及植物的生长特性对盆栽及时更换；</span></b><span style=\"font-size:12.0pt;font-family:宋体\">招标人认为盆栽不合格的，中标人须立即更换；更换期限为<span>24</span>小时，逾期一天每盆扣<span>50</span>元，依此类推；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>5</span>）所摆放的盆栽、绿化景观均由中标人派人员养护（含浇水、修建、整理），养护人员发生的一切问题和责任与招标人无关，相关的一切费用或民事、刑事责任均由中标人自行承担；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>6</span>）招标人如需临时在全院内增加盆栽（花），中标人须在<span>3</span>日内准备到位，经院方确认后按中标单价按实结算。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3.2</span><span style=\"font-size:12.0pt;font-family:宋体\">绿化养护</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">室内绿化招租范围：盐城市第一人民医院主院区；绿化养护工作分为基本工作项目和定期工作项目等两部分。基本工作指一般性正常维护，即浇水、清理垃圾及零星病虫害防治、除杂草、清除病树、枯枝等；定期工作指每季度全面修建整形、施肥、除杂草、松土、全面病虫害防治及防寒涂白工作。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:36.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">工作要求：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>1</span>）草坪高度应保持在<span>10-15cm</span>以内，每年修剪必须不少于<span>6</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>2</span>）应对所有绿地进行彻底连根除草，消灭杂草乱生的现象，禁止喷洒除草药剂，每年除草必须不少于<span>5</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>3</span>）树木修剪包含乔木和灌木的整形修剪、抹芽、清理徒长枝、枯枝、病枝等，每年不少于<span>6</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>4</span>）应结合天气情况，每年<span>1-4</span>月份，如出现干旱，每月应至少浇水一次；每年<span>5-10</span>月份，应根据气温变化及时浇水，做好抗高温和抗旱工作；并在雨季期间做好排水措施；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>5</span>）在春季、秋季期间，对所有绿化全面施肥至少<span>2</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>6</span>）病虫害防治工作应预防为主，要及时发现并立即处理病虫害；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>7</span>）针对超低温天气，须对特殊树木（如香樟）采取防寒措施； </span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>8</span>）对主次干道行道树在每年秋季涂白一次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>9</span>）绿化养护作业时，不得影响医院正常的医疗秩序。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">具体详见招标人的要求和工程量清单。<b>招标人保留调整</b></span><b><span style=\"font-size:12.0pt;font-family:宋体\">绿化种类的权利，中标人须无条件服从。</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.4</span><span style=\"font-size:12.0pt;font-family:宋体\">服务期：<span> 3 </span>年，</span><span style=\"font-size:12.0pt;font-family:宋体\">合同按年签订。经招标人年度考核合格后，可续签下一年合同；考核不合格的，招标人</span><span style=\"font-size:12.0pt;font-family:宋体\">有权立即终止合同。</span><span style=\"font-size:\r\n12.0pt;font-family:宋体\">具体开始日期以招标人的书面通知为准。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2 </span></b><b><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.1</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须是具有有效的含园林绿化经营范围的企业营业执照的独立法人。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.2</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须具备自营苗木花场场所并提供相关证明材料。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">3</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>31</span>日<span>8</span>时<span>30</span>分至<span>2021</span>年<span>9</span>月<span>4</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">4</span><span style=\"font-family:宋体;background:white\">、本项目采用“综合评估法”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">5</span><span style=\"font-family:宋体;background:white\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">6</span><span style=\"font-family:宋体;background:white\">、招投标监督管理机构及投诉电话：盐城市第一人民医院纪检监察室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">其余内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp; </span><span style=\"font-family:宋体;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white;word-break:break-all\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-family:宋体;background:white\">时间：<span>2021</span>年<span>8</span>月<span>31</span>日<span>&nbsp; </span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2255','3077','1','','','盐城市第一人民医院主院区负一层汽车坡道排污泵改造项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。1.项目概况与招标内容1.1项目名称：盐城市第一人民医院主院区负一层汽车坡道排污泵改造项目1.2项目地点：盐城市第一人','172.16.100.2','172.16.100.2','1630400858','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">盐城市第一人民医院主院区负一层汽车坡道排污泵改造项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';margin-left:21.0pt;text-align:left;\r\nline-height:21.0pt\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">1.</span><span style=\"font-size:12.0pt;font-family:宋体\">项目概况与招标内容</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">1.1</span><span style=\"font-family:宋体;background:white\">项目名称：盐城市第一人民医院主院区负一层汽车坡道排污泵改造项目</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">1.2</span><span style=\"font-family:宋体;background:white\">项目地点：盐城市第一人民医院主院区（人民南路<span>66</span>号）</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体\">1.3</span><span style=\"font-family:宋体\">工期要求： <span>15 </span>日历天，具体开工日期以招标人的通知为准。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:21.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.4</span><span style=\"font-size:12.0pt;font-family:宋体\">质量要求：符合国家“合格”标准，质保期<span>2</span>年，质保期内</span><span style=\"font-size:12.0pt;font-family:宋体\">保期内若排污泵、控制柜、浮球等发生故障，</span><span style=\"font-size:12.0pt;font-family:宋体\">由中标人负责修复，所有费用均由中标人承担。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:21.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.5</span><span style=\"font-size:12.0pt;font-family:宋体\">发包方式：包工包料。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体;background:white\">投标人具有独立法人资格，且营业执照经营范围包含机电设备或电机、水泵安装或维修等内容。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:24.0pt;\r\nmargin-bottom:.0001pt;line-height:23.0pt;background:white\"><span style=\"font-family:宋体;color:black;background:white\">3</span><span style=\"font-family:宋体;color:black;background:white\">、投标报名及招标文件的获取</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:25.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;background:white\">请符合上述资质条件的投标人携带单位介绍信（或授权委托书，须注明联系人、电话及邮箱）原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名，投标报名时间<span>2021</span>年<span>8</span>月<span>31</span>日<span>8</span>时至<span>2021</span>年<span>9</span>月<span>4</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">4</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、</span><b><span style=\"font-family:宋体\">本项目评标办法采用“合理低价法”</span></b><span style=\"font-family:宋体;color:black;background:white\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">5</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">6</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、招投标监督管理机构及投诉电话：盐城市第一人民医院纪检监察室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:23.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;background:white\">其余内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:right;\r\ntext-indent:24.0pt;line-height:25.0pt;background:white\" align=\"right\"><span style=\"font-family:宋体;color:black;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:宋体;color:black;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:right;\r\nline-height:25.0pt;background:white;word-break:break-all\" align=\"right\"><span style=\"font-family:宋体;color:black;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-family:宋体;color:black;background:white\">时间：<span>2021</span>年<span>8</span>月<span>31</span>日<span>&nbsp; </span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2256','3078','1','','','一、盐城市儿童医院热水系统改造项目已经相关部门批准建设。工程所需资金自筹，已落实。项目已具备招标条件，现对该本工程进行公开招标。本次招标对投标报名人的资格审查采用资格后审方法确定合格的投标人。 二、盐城市招标代理有限公司受招标人委托具体负责本工程的招','172.16.100.2','172.16.100.2','1630655214','<h1 style=\"margin:0cm;margin-bottom:.0001pt;text-indent:21.0pt;line-height:\r\n23.0pt;layout-grid-mode:char\"><span style=\"font-size:10.5pt;font-family:宋体;\r\ncolor:black;font-weight:normal\">一、盐城市儿童医院热水系统改造项目已经相关部门批准建设。工程所需资金自筹，已落实。项目已具备招标条件，现对该本工程进行公开招标。本次招标对投标报名人的资格审查采用资格后审方法确定合格的投标人。<span><br>\r\n&nbsp;&nbsp;&nbsp; </span>二、盐城市招标代理有限公司受招标人委托具体负责本工程的招标事宜。<span><br>\r\n&nbsp;&nbsp;&nbsp; </span>三、项目概况<span><br>\r\n&nbsp;&nbsp; 1</span>、项目名称：盐城市儿童医院热水系统改造项目。<span><br>\r\n&nbsp; 2</span>、工程地点：盐城市毓龙西路<span>6</span>号。<span><br>\r\n&nbsp; 3</span>、工程规模：本工程造价约<span>29</span>万元。 <span><br>\r\n&nbsp; 4</span>、质量标准<span>: </span>合格。<span><br>\r\n</span><span>&nbsp; 5</span>、工期要求：<span>20</span>日历天。<span><br>\r\n</span><span>&nbsp; </span>四、标段划分及招标内容<span><br>\r\n&nbsp; 1</span>、招标内容：盐城市儿童医院热水系统改造项目的施工，具体数量及规格等要求详见工程量清单和设计图纸，招标人保留对上述工程规模进行适当调整的权利。<span><br>\r\n&nbsp; </span>五、投标人主要资格要求<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></h1>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-indent:21.0pt;line-height:23.0pt;\r\nlayout-grid-mode:char\"><span style=\"font-size:10.5pt;color:black\">1</span><span style=\"font-size:10.5pt;\r\ncolor:black\">、投标人资质要求：投标人须具有建设行政主管部门核发的建筑机电安装专业承包三级及以上资质的独立法人，并持有安全生产许可证。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-indent:21.0pt;line-height:23.0pt;\r\nlayout-grid-mode:char\"><span style=\"font-size:10.5pt;color:black\">2</span><span style=\"font-size:10.5pt;color:black\">、项目负责人的资格要求：项目负责人必须是投标人本单位的正式职工，并具有机电安装工程专业的二级（含）以上建造师注册证书，同时应具有安全生产考核合格证（<span>B</span>类）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:23.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-family:宋体;color:black\">六、投标保证金：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:23.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-family:宋体;color:black\">本项目投标保证金为人民币叁仟元整，具体交纳方式详见招标文件约定。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:23.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-family:宋体;color:black\">八、本项目评标办法采用“竞争性磋商”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:23.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-family:宋体;color:black\">九、投标报名及招标文件领取时间和地点</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:宋体;margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:23.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-family:宋体;color:black\">请符合要求的潜在投标人于<span>2021</span>年<span>9</span>月<span>3</span>日至<span>