INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2258','3080','1','','','盐城市第一人民医院就其所需的（弱电）智能化系统维保进行公开招标,现欢迎符合条件的投标人参加投标。一、项目名称项目名称：盐城市第一人民医院（弱电）智能化系统维保二、项目简要说明1、项目地点：盐城市第一人民医院2、维保期限：1年。3、质量标准：符合相关的（弱','172.16.100.2','172.16.100.2','1631084760','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">盐城市第一人民医院就其所需的（弱电）智能化系统维保进行公开招标<span>,</span>现欢迎符合条件的投标人参加投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">一、项目名称</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">项目名称：盐城市第一人民医院（弱电）智能化系统维保</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">二、项目简要说明</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">1</span><span style=\"font-family:宋体\">、项目地点：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">2</span><span style=\"font-family:宋体\">、维保期限：<span>1</span>年。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">3</span><span style=\"font-family:宋体\">、质量标准：符合相关的（弱电）智能化法规、规范和技术要求，确保（弱电）智能化系统、设备正常运行。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">4</span><span style=\"font-family:宋体\">、维保范围及内容：盐城市第一人民医院主院区（人民南路<span>66</span>号）、北区（毓龙西路<span>166</span>号）、儿童医院（毓龙西路<span>6</span>号）、五官科医院（南城河路<span>12</span>号）等所有（弱电）智能化系统设施的维护、管理、保养和免费更换部分零配件工作，维保范围包含但不仅限于以下系统：监控系统、病房呼叫系统、综合布线系统、一卡通系统、教学会议系统、零星内网及电话布线等。具体内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">5</span><span style=\"font-family:宋体\">、本项目设立最高限价为人民币<span>29</span>万元。 </span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">三、合格投标人资格要求</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">1</span><span style=\"font-family:宋体\">、投标人资质类别和等级<span>:</span>须是具有建设行政主管部门核发的电子与智能化工程二级及以上专业承包资质的独立法人，并取得安全生产许可证。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">2</span><span style=\"font-family:宋体\">、财务要求：投标人应具有独立订立合同的能力，未处于财产被接管、冻结和破产状态。<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">3</span><span style=\"font-family:宋体\">、信誉要求：投标人没有被国家、江苏省省级有关部门及盐城市级有关部门暂停招投标或市场准入资格且在公示处罚期内。\r\n</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">4</span><span style=\"font-family:宋体\">、项目负责人的资格要求：项目负责人必须是投标人本单位正式职工，取得二级及以上机电</span><span style=\"font-family:宋体\">安装专业注册建造师资格，并具有有效的安全生产考核合格证书（<span>B</span>类）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">5</span><span style=\"font-family:宋体\">、投标申请人须保证项目负责人及委托代理人均为本单位的正式职工，并确保从投标截止之日当月向前连续<span>6</span>个月均已在本单位缴纳养老保险（例：如开标日期为<span>2020</span>年<span>7</span>月的某一天，则投标单位需保证以上人员<span>2020</span>年<span>1-6</span>月养老保险均在本单位缴纳）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">6</span><span style=\"font-family:宋体\">、未被“信用中国”网站（<span>www.creditchina.gov.cn</span>）列入失信被执行人、重大税收违法案件当事人名单、政府采购严重失信行为记录名单。<span>&nbsp; </span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">7</span><span style=\"font-family:宋体\">、本项目不接受联合体参与投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">四、投标报名方式及招标文件的获取</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">请符合上述资质条件的投标人携带单位介绍信（或授权委托书，须注明联系人、电话及邮箱）原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名，投标报名时间<span>2021</span>年<span>9</span>月<span>8</span>日<span>8</span>时至<span>2021</span>年<span>9</span>月<span>13</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">五、投标保证金</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">1</span><span style=\"font-family:宋体\">、投标人在递交投标文件的同时，应按规定的金额、形式递交投标保证金，并作为其投标文件的组成部分。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">2</span><span style=\"font-family:宋体\">、投标保证金为人民币<span> 5000 </span>元（现金）当场递交。未中标人的投标保证金在确认对中标结果无异议的情况下可当场退还；中标人的投标保证金自动转为履约保证金仍存于招标人处，待工程结束并通过验收后且无违约情况方可退还（无息）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">3</span><span style=\"font-family:宋体\">、投标截止时间前各投标人必须将当场提交投标保证金，投标保证金须密封装订，如不密封装订，招标文件不予收理；未提供投标保证金的，招标人拒绝接收投标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">4</span><span style=\"font-family:宋体\">、发生下列情况之一，招标人有权取消其中标资格，并没收其投标保证金：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">（<span>1</span>）投标人在投标有效期间，投标人撤回或撤销投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">（<span>2</span>）中标人无正当理由拒绝签订合同。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">（<span>3</span>）投标人在投标过程中弄虚作假，干扰正常招、投标秩序。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">（<span>4</span>）投标人相互围标、串标的。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">（<span>5</span>）中标后无正当理由不与招标人签订合同，或者在签订合同时向招标人提出附加条件或者更改合同实质性内容要求的。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';margin-top:0cm;margin-right:0cm;margin-bottom:6.0pt;margin-left:21.0pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:21.0pt;line-height:25.0pt\"><span style=\"font-family:宋体\">（<span>6</span>）中标后拒不按照招标文件的要求提交履约保证金的。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;color:black;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;color:black;background:white\">&nbsp;</span><span style=\"font-size:10.5pt;font-family:宋体;color:black;background:white\">&nbsp;</span><span style=\"font-size:10.5pt;font-family:宋体;color:black;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Times New Roman\',\'serif\';text-align:right;background:white;word-break:break-all\" align=\"right\"><span style=\"font-size:10.5pt;font-family:宋体;color:black;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-size:10.5pt;font-family:宋体;color:black;background:\r\nwhite\">时间：<span>2021</span>年<span>9</span>月<span>8</span>日<span>&nbsp; </span></span></p>','','','','','');
